import React from 'react';
import {LeaderBoard,Rewards,Profile} from './Icons'; 

const Header = ()=> {
    return(
        <>
            <header>
                <div className="topLinks">
                    <a href=""><LeaderBoard /><span>Leadership Borad</span></a>
                    <a href=""><Rewards /><span>Rewards</span></a>
                    <a href=""><Profile /><span>My Profile</span></a>
                </div>
            </header>
        </>
    );
}

export default Header;
